import axios from "axios"
import React, { useEffect, useState } from "react"
import { useParams } from "react-router-dom"
import "./u-enter.css"



function Userenter(){

    let {userId} = useParams()

    let [user, setuser] = useState([])
    let [lawyer , setlawyer] = useState([])

    const gather = async () => {

         await axios
         .get(`http://localhost:7000/user?userId=${userId}`)
         .then((res) => {
            console.log(res.data)
             setuser(res.data)

         })
         .catch((err) => {
            console.log(`${err}`)
         })
         await axios
         .get("http://localhost:7000/getlawerd")
         .then((res) => {
              console.log(res.data)
             setlawyer(res.data)

         })
         .catch((err) => {
             console.log(`${err}`)
         })
        }

    console.log('user', user)
useEffect(() => {
    gather() 
},[])

    return(
        <div className="wlc-u"> 
        <div>
           <h1>Welcome {user.name} </h1>
           </div>
          <div className="u-e-r">
          <div class="card11">
            <p class="title1">Who to follow</p>
            {lawyer.map(value => (
            <div class="user__container1">
               <div class="user1">
                 <div class="image1">
                    <img src={`http://localhost:7000/static/${value.originalname}`} />
                 </div>
                   <div class="user__content1">
                    <div class="text1">
                     <span class="name1">{value.name}</span>
                     <p class="username1">@namedlorem</p>
                    </div>
                    <button class="follow1">Follow</button>
                 </div>

               </div> 

           </div>
           ))}
         </div>
         </div>
    </div>

    )
}

export default Userenter
